import React, { Component } from 'react';
import { useNavigate } from 'react-router-dom';
const Button = ({to}) => {

    const navigate = useNavigate();


    return (
            <button className="custom-button" onClick={() =>
            { navigate('/${to}') }}>    
            Take me to {to === '' ? "home" : to}
            </button>

    )
}

export default Button;
